import request from '@/utils/request'; // 查询设备报警列表

export function queryDeviceAlarm(query) {
  return request({
    url: "/iotIot/iot/report/alarm/device",
    method: 'get',
    params: query
  });
} // 查询设备报警列表

export function queryAatewayAlarm(query) {
  return request({
    url: "/iotIot/iot/report/alarm/gateway",
    method: 'get',
    params: query
  });
}
